import {createAction} from 'redux-actions';

export const ServerActions = {
    RXWS_CLIENT_CONNECTED: {
        name: "RXWS_CLIENT_CONNECTED",
        action: createAction("RXWS_CLIENT_CONNECTED", x=>x, ()=> defaultServerMetadata)
    },
